import { getSpaceUntilMaxLength } from "@testing-library/user-event/dist/utils";
import React, { useState, useEffect } from "react";
import { Container, Row, Col } from "react-bootstrap";
import { useParams, useHistory } from "react-router-dom";
import { getGoal, getMilestones } from "../../ApiManager";
import "./GoalMilestone.css";

export const GoalMilestone = () => {
  const history = useHistory();
  const { goalsId } = useParams();
  const [goal, setGoal] = useState("");
  const [direction, setDirection] = useState({});
  const [defined, setDefined] = useState({});
  const [progress, setProgress] = useState({});
  const [features, setFeatures] = useState({});
  const [attained, setAttained] = useState({});
  const [notes, setNotes] = useState({});
  const [milestone, setMilestone] = useState([]);
  // const [milestone, setMilestone] = useState({
  //   direction: false,
  //   defined: false,
  //   progress: false,
  //   features: false,
  //   attained: false,
  //   notes: "",
  // });

  const saveMilestone = (goalsId) => {
    const mileChecker = milestone.find((mileObj) => {
      return (
        mileObj.userId === parseInt(localStorage.getItem("goal_keeper")) &&
        mileObj.goalId === goalsId
        );
      });
      console.log(mileChecker)

    // let newMilestoneObject = {
    //   direction: direction,
    //   defined: defined,
    //   progress: progress,
    //   features: features,
    //   attained: attained,
    //   notes: notes,
    //   userId: parseInt(localStorage.getItem("goal_keeper")),
    // };
    // fetch(`http://localhost:8088/goals/${goalsId}`, {
    //   method: "PUT",
    //   headers: {
    //     "Content-Type": "application/json",
    //   },
    //   body: JSON.stringify(newMilestoneObject),
    // }).then(() => {
    //   history.push("/mygoals");
    // });

    // const fetchObject = {
    //   method: "POST",
    //   headers: {
    //     "Content-Type": "application/json",
    //   },
    //   body: JSON.stringify(newMilestoneObject),
    // };
    // return fetch(`http://localhost:8088/milestones`, fetchObject).then(() => {
    //   history.push("/mygoals");
    // });
  };

  useEffect(() => {
    getGoal(parseInt(goalsId)).then((data) => {
      setGoal(data);
    });
  }, []);

  useEffect(() => {
    getMilestones().then((data) => {
      setMilestone(data);
    });
  }, []);

  return (
    <>
      <Container className="container">
        <h3 className="milestone-rev">Milstone Review</h3>
        <Container>
          <fieldset>
            <div className="form-group">
              {/* <Row xs={4} md={2}>
                <Col xs={6}> */}
              <input
                className="dirbx"
                type="checkbox"
                label="My Value"
                value={""}
                onChange={(event) => {
                  setDirection(event.target.checked);
                }}
              />
              {/* </Col>
                </Row> */}
              <Row>
                <Col>
                  <label className="title" htmlFor="name">
                    Overall Direction
                  </label>
                </Col>
              </Row>
            </div>
          </fieldset>
        </Container>
        <Container>
          <fieldset>
            <div className="form-group">
              {/* <Row xs={4} md={2}>
              <Col xs={6}> */}
              <input
                className="defbx"
                type="checkbox"
                label="My Value"
                value={""}
                onChange={(event) => {
                  setDefined(event.target.checked);
                }}
              />
              {/* </Col>
                </Row> */}
              <Row>
                <Col>
                  <label className="title" htmlFor="name">
                    Flushed And Defined
                  </label>
                </Col>
              </Row>
            </div>
          </fieldset>
        </Container>
        <Container>
          <fieldset>
            <div className="form-group">
              {/* <Row xs={4} md={2}>
              <Col xs={6}> */}
              <input
                className="featbx"
                type="checkbox"
                label="My Value"
                value={""}
                onChange={(event) => {
                  setProgress(event.target.checked);
                }}
              />
              {/* </Col>
                </Row> */}
              <Row>
                <Col>
                  <label className="title" htmlFor="name">
                    Tangible Progress Made
                  </label>
                </Col>
              </Row>
            </div>
          </fieldset>
        </Container>
        <Container>
          <fieldset>
            <div className="form-group">
              {/* <Row xs={4} md={2}>
              <Col xs={6}> */}
              <input
                className="featbx"
                type="checkbox"
                label="My Value"
                value={""}
                onChange={(event) => {
                  setFeatures(event.target.checked);
                }}
              />
              {/* </Col>
                </Row> */}
              <Row>
                <Col>
                  <label className="title" htmlFor="name">
                    Features Completed
                  </label>
                </Col>
              </Row>
            </div>
          </fieldset>
        </Container>
        <Container>
          <fieldset>
            <div className="form-group">
              {/* <Row xs={4} md={2}>
              <Col xs={6}> */}
              <input
                className="attbx"
                type="checkbox"
                transform="scale(4)"
                label="My Value"
                value={""}
                onChange={(event) => {
                  setAttained(event.target.checked);
                }}
              />
              {/* </Col>
                </Row> */}
              <Row>
                <Col>
                  <label className="title" htmlFor="name">
                    Goal Objective Attained
                  </label>
                </Col>
              </Row>
            </div>
          </fieldset>
          {/* <Container> */}
          <fieldset>
            <div className="form-group">
              {/* <Row xs={4}>
                  <Col xs={6}> */}
              <label className="title" htmlFor="name">
                Notes
              </label>
              {/* </Col>
                </Row> */}
              {/* <Container>
                  <Row>
                    <Col> */}
              <textarea
                rows="8"
                cols="60"
                className="textarea"
                placeholder="Enter milestone notes here..."
                onChange={(event) => {
                  setNotes(event.target.value);
                }}
              ></textarea>
              {/* </Col>
                  </Row>
                </Container> */}
            </div>
          </fieldset>
          {/* </Container>
        </Container> */}
        </Container>
        {/* <Container>
          <Row>
            <Col> */}
        <button
          key={"save-btn"}
          className="saveMilestone-btn"
          onClick={saveMilestone}
        >
          Save
        </button>
        {/* </Col>
          </Row>
        </Container> */}
      </Container>
    </>
  );
};
